column18:
@RampCapitalLLC POTUS received #Regeneron 's antibody drug to treat #COVID19 and testimonial from a patient that received it in August,

she says it saved her life and that she noticed improvement (able to smell again, etc.)  within two days.

https://t.co/IuPVSJ48JU

@DrMattAU @RampCapitalLLC "Need" is a bit subjective. 

But if you're over 70 years old and/or have other co-morbidities you may want one. 

Also, just because a given disease may not outright kill you, there can still be benefit in preventing it.

@RampCapitalLLC Good translational and clinical science cannot be stopped.

The question is always timeline. Will we have a vaccine? SARS-CoV-2 actually mutates at a lower rate compared to similar viruses, this is good for vaccine development.

Will it be done in weeks/months? Let's see.

@RampCapitalLLC or one that provides sufficiently long term protection?

What we really need is a FAST CHEAP ACCURATE saliva-based test.

Or even a finger stick blood test similar to diabetes testing

@RampCapitalLLC $LONE easy mula
Do your own due diligence
Do not hold longer than one month if you impulse buy
